import React from 'react';
import ReactDOM from 'react-dom/client';

function Tick() {
  const root = ReactDOM.createRoot(
    document.getElementById('root')
    );
  const element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
  root.render(element);
}

setInterval(Tick, 1000);

export default Tick;
